import React from "react";
import styled from "styled-components";

const Header = (props) => {
  return (
    <React.Fragment>
      <Title>
          Gaesi-pan
      </Title>

      <Buttonset>
        <button>모든 포스팅</button>
        <button>글쓰기</button>
        <button>소개</button>
      </Buttonset>

      <hr style={{width: 1200, }}/>
    </React.Fragment>
  );
};

const Title = styled.div`
text-align: center;
font-size: 60px;
margin: 50px auto;
`;

const Buttonset = styled.div`
display: flex;
text-align: center;
`;
export default Header;
